export const simpleAction = () => dispatch => {
  fetch("https://dog.ceo/api/breeds/list/all")
    .then(response => {
      console.log(JSON.stringify(response));
      //   return response.json();
      dispatch({
        type: "SIMPLE_ACTION",
        payload: "result_of_simple_action"
      });
    })
    .then(data => {
      console.log(data);
    });
};
